import React, { Component } from "react";

class CountDisplay extends Component {
      constructor(props) {
            super(props);
            this.loadCounts = this.loadCounts.bind(this);
      }

      loadCounts() {
            let countJSON = this.props.Level;
            console.log(countJSON.Level3);
      }

      render() {
            return (
                  <>
                        <div className="CountDisplay">
                              <h1> 23 </h1>
                              <p> Level 3 </p>
                              <button
                                    type="button"
                                    className="btn btn-primary sideBarButton"
                                    onClick={this.loadCounts}
                              >
                                    Login
                              </button>
                        </div>
                  </>
            );
      }
}

export default CountDisplay;
